import { Link, useLocation } from "react-router-dom";

function KanbasNavigation() {
    const navItems = [
      { name: 'Account', icon: 'fa-circle-user', link: 'account/index.html' },
      { name: 'Dashboard', icon: 'fa-gauge', link: 'home/dashboard.html' },
      { name: 'Courses', icon: 'fa-book', link: 'courses/' },
      { name: 'Calender', icon: 'fa-calendar-days', link: 'Calender/' },
      { name: 'Inbox', icon: 'fa-inbox', link: 'Inbox/' },
      { name: 'History', icon: 'fa-clock', link: 'History/' },
      { name: 'Studio', icon: 'fa-tv', link: 'Studio/' },
      { name: 'Commons', icon: 'fa-arrow-right-from-bracket', link: 'Commons/' },
      { name: 'Help', icon: 'fa-circle-question', link: 'Help/' },

    ];

    return (
      <div class="wd-main-navbar-content">
        <div className="wd-main-navbar-item-container">
            <Link className="wd-main-navbar-link kanbas-app-logo" to="/" />
        </div>
        <ul className="wd-kanbas-navigation">
          {navItems.map(item => (
            <li key={item.name}>
              <Link to={item.link}>
                <i className={`fas ${item.icon} wd-nav-item-icon white`}></i>
                <p>{item.name}</p>
              </Link>
            </li>
          ))}
        </ul>
      </div>
    );
  }

  export default KanbasNavigation;
